import React from "react"
import axios from "axios"
import Form from "./Form"

const baseUrl = "https://passgen-server.herokuapp.com/"

class App extends React.Component {
    constructor(props) {
        super(props)
        this.state = {
            password: ''
        }
    }

    render() {
        return <Form genBtn = {this.genBtn} />
    }
}

export default App
